import React from "react";
import "../../styles/intro.css";
import photo from "../../assets/my-pic.jpeg.PNG";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faGithub, faLinkedin } from "@fortawesome/free-brands-svg-icons";
function Intro() {
  return (
    <div className="intro-container">
      <div className="intro-details">
        <h1 className="title">Hi! I Am</h1>
        <h1 className="name">Vishal Voorugonda</h1>
        <p className="content">
          Iam a frontend-developer a recently graduate in civil Engineering from
          jayamukhi institute of technological and science and after bteh i
          joined the coding ninjas and
        </p>
        <button className="hire">Hire me</button>
         <div className="links-img">
      <a href="https://github.com/vishalvoorugonda" target="_blank" rel="noopener noreferrer" className="social-icon git">
        <FontAwesomeIcon icon={faGithub} />
      </a>
      <a href="https://linkedin.com/in/vishalvoorugonda" target="_blank" rel="noopener noreferrer" className="social-icon linkedin">
        <FontAwesomeIcon icon={faLinkedin}  />
      </a>
    </div>
      </div>
      <div className="my-pic">
        <img src={photo} alt="my-img" />
      </div>
    </div>
  );
}

export default Intro;
